import React from 'react'
import './GroupDetailView.scss';

function GroupDetailView() {
    return (
        <div>
            <div className="groupDetail__ImageField">
                <div className="">
                    <img src="./images/Event_listing_BG.png" alt="group"/>
                </div>
            </div>
        </div>
    )
}

export default GroupDetailView
